funcReserve:
  function funcReserve() {
    log("funcReserve");

    if (!suffix) return;

    const suffixParam = (() => {
      const result = {};
      suffix.split("&").forEach((item) => {
        const dv = item.split("=");
        result[dv[0]] = dv[1];
      });
      return result;
    })();

    log("settype", suffixParam["settype"]);
    if (suffixParam["settype"] == "") {
      log("calendar");
      funcDate();
    } else if (suffixParam["settype"] == "T") {
      log("time");
      funcTime();
    } else {
      return;
    }
  }

funcDate:
  function funcDate() {
    log("funcDate");
    const tag = localStorage.getItem("TZ_LOGOUT");
    if (tag && new Date().getTime() - tag < 1000 * 5) return;
    localStorage.setItem("TZ_LOGOUT", new Date().getTime());

    TZLOG(logParam, (data) => {
      let sign = fulldate.daySign();
      if (sign != 1) sign = 2;
      timefrom_change(fulldate, sign, fulldate.dayNum(), "", "00", "T");
    });
  }

funcTime:
  function funcTime() {
    log("funcTime");
    const els = document.gcn("cm_btn default");
    let target;
    els.every((el) => {
      const param = el.attr("onclick").inparen();
      const elTime = param[2];
      const elCourse = param[1];
      log(elTime, time, elCourse, dictCourse[course]);
      log(elTime == time, elCourse == dictCourse[course]);
      if (elTime == time && elCourse == dictCourse[course]) target = el;

      return !target;
    });

    log("target", target);
    if (target) {
      target.click();
      timer(1000, funcExec);
    } else {
      funcEnd();
    }
  }

funcExec:
function funcExec() {
  log("funcExec");
  document.gcn("cm_btn default")[0].click();
  setTimeout(LOGOUT, 1000);
}

funcEnd:
function funcEnd() {
  log("funcEnd");
  const strEnd = "end of reserve/reserve";
  logParam.message = strEnd;
  TZLOG(logParam, (data) => {});
  if (ac) ac.message(strEnd);
}
